import './App.css';
import MapView from './components/MapView'; 
import Home from '.'
import {BrowserRouter as Router, Switch,Route}from 'react-router-dom';


function App() {
  return (

    <Router>
      <Switch>
        <Route path="/map">
        <MapView/>
        </Route>
        <Route path="/">
          <Home/>
        </Route>
      </Switch>
    </Router>

    );
}

export default App;
